function M_i = mir3d(axis)

    switch axis
        case 1
            M_i = [-1 0 0;
                0 1 0;
                0 0 1];
        case 2
            M_i = [1 0 0;
                0 -1 0;
                0 0 1];
        case 3
            M_i = [1 0 0;
                0 1 0;
                0 0 -1];
        otherwise
            error('Choose 1, 2 or 3');
    end

end

