for i = 1:numel(Mmat)
    [Ei, it] = kepler(Mmat(i), Emat(i));
    Esol(i) = Ei;
    IT(i) = it;
end

Diff = Esol - Mmat;

figure; mesh(Mgrid, egrid, Diff); %[output:98156fa3]
