%[text] Exercise 5: Write a function that computes the Julian Date and Modified Julian Date from a given Gregorian calendar date specified as year, month, day, hour, minute and second.
%[text] (a) Compute the Earth Rotation Angle (ERA) at 2025-04-10, 02h:00m:00s CET and specify it in degree, minute and second to one second precision.
%[text] (b) Compute the Greenwich Apparent Sidereal Time (GAST) at 2025-04-10, 02h:00m:00s CET and specify it in hour angle, minute and second to one second precision.
% to-do
% 
function [JD, MJD] = julianDate(year, month, day, hour, minute, second)
    
    if month <= 2
        year = year - 1;
        month = month + 12;
    end
    
    A = floor(year / 100);
    B = 2 - A + floor(A / 4); % Gregorian calendar correction

    JDN = floor(365.25 * (year + 4716)) + floor(30.6001 * (month + 1)) + day + B - 1524.5;
    
    % Convert time to fractional day (UT1/UTC)
    fractional_day = (hour + minute / 60 + second / 3600) / 24;

    % Julian Date
    JD = JDN + fractional_day;
    
    % Modified Julian Date (MJD = JD - 2400000.5)
    MJD = JD - 2400000.5;

end
%[text] 
function era = era_angle(JD)
    JD_0 = 2451545.0; 
    delta_t = JD - JD_0;

    era = 2*pi*(0.7790572732640 + 1.00273781191135448 * delta_t);
    era = mod(era, 2*pi);
end
%[text] 
function gast = gast_angle(JD)
    T = (JD - 2451545.0)/36525;
    GMST = mod( 67310.54841 + ...
           (876600*3600 + 8640184.812866)*T + ...
           0.093104*T.^2 - 6.2e-6*T.^3 , 86400 );

    GMST = GMST * (pi/43200);

    eqeq = 0; % small term, ignored in simple model
    gast = mod(GMST + eqeq, 2*pi);
end
