%[text] Exercise 6 (optional): The baseline length of the Westford ‚Äì Wettzell baseline is about 6000 km in ITRF. At 2025-04-10, 12:00:00 UTC, a VLBI group delay ‚àÜùë°ùë° in TT is measured to be 20 ms on this baseline. Compute the difference of the delay in TT vs. TCB compatible seconds using the TT to TCG and TCG to TCB coordinate time transformations. Then specify the delay difference in meter. What solar system bodies are significant for the general relativistic transformation when taking 99.99% significance level into consideration? Show that the gravitational relativistic term is about twice as large as the special relativistic term.
% to-do
% 
function dt = TT_to_TCG(TTsec)
    LG = 6.969290134e-10;
    dt = TTsec * LG;
end

%[text] 
function dt = TCG_to_TCB(TCGsec)
    LB = 1.550519768e-8;
    dt = TCGsec * LB;
end

